(24, 'حسين زكي الخباز', 'Hussain.kh@sowarstock.com', '0508990660', 'السلام عليكم ورحمة الله وبركاته\r\n\r\nأنا حسين الخباز\r\nمؤسس #صورستوك\r\nوهي شركة متخصصة في نفس مجال عربستوك، أنشأناها متد العام ٢٠١٧. أتواصل معكم هنا رغبة في التعاون معكم أو حتى الانضمام لفريقكم.\r\n\r\nولكم جزيل الشكر', NULL, '2020-06-12 06:52:46', '2020-06-12 06:52:46'),
(25, 'عبدالعزيز الملحم', 'le777on@hotmail.com', '+966506827123', 'أنا مصور هل استطيع مشاركة الصور في موقعكم؟ كيف هي الطريقة و ماهو المردود المالي ؟\r\nشكرا لكن', NULL, '2020-06-12 07:56:28', '2020-06-12 07:56:28'),
(26, 'Hatim', 'Hatim.tj@gmail.com', '0555573637', 'السلام عليكم و رحمة الله و بركاته، هل يمكن لمصور محترف تحميل صوره ليتم بيعها على المنصة ؟  إذا كان الجواب نعم، كيف يتم احتساب العائد للمصور من بيع الصور ؟', NULL, '2020-06-12 08:25:13', '2020-06-12 08:25:13'),
(27, 'Ali', 'alisabkar@gmail.com', '+97336145666', 'لدي مصورين ودهم المشاركة بتسويق محتواهم عبر منصتكم. لم نجد على الموقع اي طريقه للانضمام. \r\n\r\nشكرا لكم على المشروع الرائع', NULL, '2020-06-12 08:42:30', '2020-06-12 08:42:30'),
