(30, 'Bassam', 'Almutairibassam@gmail.com', '00966540309808', 'في حال كنت صانع محتوى ومصور وارغب في بالمشاركة معكم بمجموعة صور من تصويري ، كيف اشارك صوري وماهو المقابل ؟', NULL, '2020-06-12 10:26:41', '2020-06-12 10:26:41'),
