(35, 'Mohammed', 'm-m.al-malki20@hotmail.com', '0582223145', 'السلام عليكم ورحمة الله وبركاته \r\nمساء الخير ، أرغب بالمشاركة في وضع صور بالموقع، لكن كيف الطريقة وكذلك وش وضع الأرباح من ذلك.', NULL, '2020-06-12 16:45:59', '2020-06-12 16:45:59'),
